body:
I download the pre-built package from https://github.com/microsoft/onnxruntime/releases/download/v1.9.0/onnxruntime-linux-x64-gpu-1.9.0.tgz, and get the same error.

By the way, I register my own op in onnxruntime as the following code:
```
Ort::CustomOpDomain custom_op_domain("");
custom_op_domain.Add(&custom_op);
session_options.Add(custom_op_domain);
Ort::ThrowOnError(OrtSessionOptionsAppendExecutionProvider_CUDA(session_options, device_id));
```
Does it matter to the error?

I want to register the new op named 'MMCVRoiAlign' which is not supported in onnxruntime.
My understanding is I should register my op with a custom domain?
I just modify the code :

`Ort::CustomOpDomain custom_op_domain("");`
to:
`Ort::CustomOpDomain custom_op_domain("abc");`

More details:
```
  Ort::Env env(ORT_LOGGING_LEVEL_WARNING, "");
  Ort::SessionOptions session_options;
  session_options.SetIntraOpNumThreads(1);
  session_options.SetGraphOptimizationLevel(GraphOptimizationLevel::ORT_ENABLE_ALL);

  cudaStream_t compute_stream = nullptr;

  MMCVRoiAlign custom_op{"CUDAExecutionProvider", compute_stream};
  //ConstantOfShape custom_op2{"CUDAExecutionProvider", compute_stream};

  Ort::CustomOpDomain custom_op_domain("abc");

  custom_op_domain.Add(&custom_op);

  session_options.Add(custom_op_domain);

  int device_id = 0;
  Ort::ThrowOnError(OrtSessionOptionsAppendExecutionProvider_CUDA(session_options, device_id));

  Ort::Session session(env, model_path, session_options);
```

When I use the custom domain "abc" , onnxruntime can't find the new registered op:
`Load model from ./faster.onnx failed:Fatal error: MMCVRoiAlign is not a registered function/op`
When I use default domain "", the above error disappear. But shows:
`Load model from ./faster.onnx failed:This is an invalid model. Error in Node:ConstantOfShape_1002 : No Op registered for ConstantOfShape with domain_version of 11`
